import React from 'react';
import Form from 'react-bootstrap/Form';

const LevelThreeForm = () => {
    return (
        <div>
            <h2>Level Three</h2>
            <Form.Group>
                <Form.Label>Image Upload</Form.Label>
                <br/>
                THREE IMAGES min
                <Form.File></Form.File>
            </Form.Group>
        </div>
    )
}

export default LevelThreeForm;
